// 是否为边缘点
std::pair<bool, COLORREF> IsEdgePoint(int x, int y)
{
	POINT t[4] = { {0,4}, {0,-1}, {4,0}, {-1,0} };

	COLORREF color = getpixel(x, y);
	if (color == RGB(255, 255, 255)) return std::make_pair(false, RGB(0, 0, 0));
	return std::make_pair(true, color);
}

// 获取目标点集
void GetDstPoints(int w, int h, HWND hWnd)
{
	// 设置临时绘图对象
	IMAGE img;
	SetWorkingImage(&img);

	setbkmode(TRANSPARENT);

	// 定义目标字符串
	TCHAR s[] = _T("HiEasyX");
	TCHAR s_ver[] = _HIEASYX_VER_STR_;

	// 计算目标字符串的宽高，并调整临时绘图对象的尺寸

	g_nHeight = 200;

	settextcolor(RGB(0, 120, 212));
	LOGFONT font{};
	gettextstyle(&font);

	font.lfHeight = 120;
	font.lfWidth = 0;
	font.lfEscapement = 0;
	font.lfOrientation = 0;
	font.lfWeight = 1000;
	font.lfItalic = false;
	font.lfUnderline = false;
	font.lfStrikeOut = false;
	font.lfQuality = PROOF_QUALITY;

#ifdef _MSC_VER
	_tcscpy_s(font.lfFaceName, _T("Arial"));
#else
	_tcscpy(font.lfFaceName, _T("Arial"));
#endif

	settextstyle(&font);

	g_nWidth += textwidth(s);
	g_nHeight += textheight(s);

	font.lfHeight = 30;
	settextstyle(&font);

	g_nHeight += textheight(s_ver);

	Resize(&img, g_nWidth, g_nHeight);
	SetImageColor(img, RGB(255, 255, 255), false);

	font.lfHeight = 120;
	settextstyle(&font);
	outtextxy(0, 200, s);
	font.lfHeight = 30;
	settextstyle(&font);
	outtextxy(g_nWidth - textwidth(s_ver), g_nHeight - textheight(s_ver), s_ver);

	IMAGE icon = CreateImageColor(200, 200, RGB(255, 255, 255), false);
	DWORD* pBuf = GetImageBuffer(&icon);
	DWORD* p = GetImageBuffer(&icon);
	memcpy(p, Icon, 200 * 200 * sizeof(DWORD));

	putimage(g_nWidth / 2 - 100, 0, &icon);

	// 计算构成目标字符串的点的数量
	int x, y;
	g_nCount = 0;
	for (x = 0; x < g_nWidth; x++)
	{
		for (y = 0; y < g_nHeight; y++)
		{
			std::pair<bool, COLORREF> color = IsEdgePoint(x, y);
			if (color.first)
			{
				g_nCount++;
			}
		}
	}

	// 计算目标数据
	g_pDst = new POINT[g_nCount];
	g_pDst_color = new COLORREF[g_nCount];

	int i = 0;
	for (x = 0; x < g_nWidth; x++)
	{
		for (y = 0; y < g_nHeight; y++)
		{
			std::pair<bool, COLORREF> color = IsEdgePoint(x, y);
			if (color.first)
			{
				g_pDst[i].x = x + (w - g_nWidth) / 2;
				g_pDst[i].y = y + (h - g_nHeight) / 2;
				g_pDst_color[i] = color.second;
				i++;
			}
		}
	}

	// 恢复对屏幕的绘图操作
	SetWorkingImage(HiEasyX::GetWindowImage(hWnd));
}
// 获取源点集
void GetSrcPoints(int w, int h)
{
	// 设置随机种子
	srand((unsigned int)time(nullptr));

	// 设置随机的源数据
	g_pSrc = new POINT[g_nCount];
	for (int i = 0; i < g_nCount; i++)
	{
		g_pSrc[i].x = 1 + rand() % (w - 1);
		g_pSrc[i].y = 1 + rand() % (h - 1);
	}
}

// 全屏模糊处理(忽略屏幕第一行和最后一行)
void Blur(DWORD* pMem, int w, int h, int speed)
{
	for (int i = w; i < w * (h - 1); i++)
	{
#ifdef _MSC_VER
		pMem[i] = RGB(
			min(255, (GetRValue(pMem[i]) + GetRValue(pMem[i - w]) + GetRValue(pMem[i - 1]) + GetRValue(pMem[i + 1]) + GetRValue(pMem[i + w])) / 5 + speed),
			min(255, (GetGValue(pMem[i]) + GetGValue(pMem[i - w]) + GetGValue(pMem[i - 1]) + GetGValue(pMem[i + 1]) + GetGValue(pMem[i + w])) / 5 + speed),
			min(255, (GetBValue(pMem[i]) + GetBValue(pMem[i - w]) + GetBValue(pMem[i - 1]) + GetBValue(pMem[i + 1]) + GetBValue(pMem[i + w])) / 5 + speed));
#else
		pMem[i] = RGB(
			std::min(255, (GetRValue(pMem[i]) + GetRValue(pMem[i - w]) + GetRValue(pMem[i - 1]) + GetRValue(pMem[i + 1]) + GetRValue(pMem[i + w])) / 5 + speed),
			std::min(255, (GetGValue(pMem[i]) + GetGValue(pMem[i - w]) + GetGValue(pMem[i - 1]) + GetGValue(pMem[i + 1]) + GetGValue(pMem[i + w])) / 5 + speed),
			std::min(255, (GetBValue(pMem[i]) + GetBValue(pMem[i - w]) + GetBValue(pMem[i - 1]) + GetBValue(pMem[i + 1]) + GetBValue(pMem[i + w])) / 5 + speed));
#endif
	}
}

void HiEasyX::RenderStartScene(HWND hWnd, int w, int h, int nPreCmdShow)
{
	GetDstPoints(w, h, hWnd);						// 获取目标点集
	GetSrcPoints(w, h);						// 获取源点集

	DisableResizing(hWnd, true); //禁止窗口拉伸
	BEGIN_TASK();

	setbkcolor(RGB(255, 255, 255));
	setbkmode(TRANSPARENT);
	cleardevice();

	END_TASK();
	REDRAW_WINDOW();

	ShowWindow(hWnd, nPreCmdShow);
	UpdateWindow(hWnd);
	DWORD* pBuf = GetImageBuffer(HiEasyX::GetWindowImage(hWnd));

	// 运算
	int x, y;
	long long sleep_time = (long long)(-1 * (0.000006276f) * (w * h) + 25);
	for (int i = 2; i <= 450; i += 3)
	{
		BEGIN_TASK();

#ifdef _MSC_VER
		int brightness = max(0, 150 - i);
#else
		int brightness = std::max(0, 150 - i);
#endif

		Blur(pBuf, w, h, i <= 256 ? 3 : int(double(i - 256) / 10) + 3);                     // 全屏模糊处理

#ifdef _MSC_VER
		int val = min(256, i);
#else
		int val = std::min(256, i);
#endif

		for (int d = 0; d < g_nCount; d++)
		{
#ifdef _MSC_VER
			x = g_pSrc[d].x + (g_pDst[d].x - g_pSrc[d].x) * val / max(256, 514 - i);
			y = g_pSrc[d].y + (g_pDst[d].y - g_pSrc[d].y) * val / max(256, 514 - i);
			pBuf[y * w + x] = RGB(min(255, GetBValue(g_pDst_color[d]) + brightness), min(255, GetGValue(g_pDst_color[d]) + brightness), min(255, GetRValue(g_pDst_color[d]) + brightness));        // 直接操作显示缓冲区画点

#else
			x = g_pSrc[d].x + (g_pDst[d].x - g_pSrc[d].x) * val / std::max(256, 514 - i);
			y = g_pSrc[d].y + (g_pDst[d].y - g_pSrc[d].y) * val / std::max(256, 514 - i);
			pBuf[y * w + x] = RGB(std::min(255, GetBValue(g_pDst_color[d]) + brightness), std::min(255, GetGValue(g_pDst_color[d]) + brightness), std::min(255, GetRValue(g_pDst_color[d]) + brightness));        // 直接操作显示缓冲区画点
#endif
		}

		END_TASK();
		REDRAW_WINDOW();

		std::this_thread::sleep_for(std::chrono::milliseconds(sleep_time));

		if (!HiEasyX::IsAliveWindow(hWnd)) break;
	}

	// 清理内存
	delete g_pDst;
	delete g_pDst_color;
	delete g_pSrc;

	std::this_thread::sleep_for(std::chrono::milliseconds(1000));

	DisableResizing(hWnd, false); //允许窗口拉伸
}